CREATE TABLE moviebase(
   genres            VARCHAR(230) NOT NULL
  ,homepage          VARCHAR(138)
  ,id                INTEGER  NOT NULL PRIMARY KEY 
  ,original_language VARCHAR(2) NOT NULL
  ,original_title    VARCHAR(86) NOT NULL
  ,release_date      DATE 
  ,runtime           INTEGER 
  ,status            VARCHAR(15) NOT NULL
  ,vote_average      NUMERIC(3,1) NOT NULL
  ,FIELD10           VARCHAR(30)
  ,FIELD11           VARCHAR(30)
  ,FIELD12           VARCHAR(30)
  ,FIELD13           VARCHAR(30)
  ,FIELD14           VARCHAR(30)
  ,FIELD15           VARCHAR(30)
  ,FIELD16           VARCHAR(30)
  ,FIELD17           VARCHAR(30)
  ,FIELD18           VARCHAR(30)
);
